// khmer-font.js â€” self-contained jsPDF VFS registration for Noto Sans Khmer
// Auto-generated from uploaded TTFs. No network requests required.
(function(global) {
  function registerKhmerFonts() {
    if (!global.jspdf || !global.jspdf.jsPDF) {
      throw new Error('jsPDF not loaded: load jsPDF before calling registerKhmerFonts()');
    }
    var jsPDF = global.jspdf.jsPDF;
    var API = jsPDF.API || jsPDF.prototype;
    if (!API.vFS) API.vFS = {};
    if (typeof API.addFileToVFS !== 'function') {
      API.addFileToVFS = function(name, data) { API.vFS[name] = data; };
    }

    // Add font binaries to VFS
    API.addFileToVFS('NotoSansKhmer-Regular.ttf', '');
    API.addFileToVFS('NotoSansKhmer-Bold.ttf', '');

    // Register family names
    API.addFont('NotoSansKhmer-Regular.ttf', 'NotoSansKhmer', 'normal');
    API.addFont('NotoSansKhmer-Bold.ttf', 'NotoSansKhmer', 'bold');
  }

  global.registerKhmerFonts = registerKhmerFonts;
})(typeof window !== 'undefined' ? window : this);
